    const [messages, setMessage]=useState('')
    useEffect(() => {
        getGreetingss();
    })

    const getGreetingss = () => {
        EmployeeService.getGreeting().then((response) => {
            setMessage(response.data.message)
            console.log(response.data);
        }).catch(error =>{
            console.log(error);
        })
    }
